import React from "react";
import {BrowserRouter as Router, Route, Switch} from "react-router-dom";
import Main from "./Components/Main";

export default function App() {
	return (
		<Router>
			<Switch>
				<Route exact path="/" component={Main} />
			</Switch>
		</Router>
	);
}
